.section .text

.globl PauseMenu
PauseMenu:
          push {r5, r6, r7, r8, r9, r10, lr}

          ldr r9, =playingstatus
          mov r10, #0
          str r10, [r9]

          ldr r1, =currentSelectionPause
          mov r2, #1
          str r2, [r1]

          mov r0, #0    //pass in starting x
          mov r1, #0    //pass in starting y
          ldr r2, =pauseMenuImage //address of picture
          ldr r7, =0x21b
          ldr r8, =0x131
          bl drawPicture

          ldr r0, =selectcoin3
          ldr r0, [r0]
          ldr r1, =selectcoin3
          ldr r1, [r1,#4]
          bl drawselectCoin

          PauseScreenLoop:
                          bl _ReadSNES
                          ldr r9, =buttons
                          ldrb r10, [r9, #4]
                          cmp r10, #0
                          bleq Up
                          ldr r9, =buttons
                          ldrb r10, [r9, #5]
                          cmp r10, #0
                          bleq Down
                          ldr r9, =buttons
                          ldrb r10, [r9, #8]
                          cmp r10, #0
                          beq restart

                          ldrb r10, [r9, #1]
                          cmp r10, #0
                          beq removeScreen
                          ldrb r10, [r9, #2]
                          cmp r10, #0
                          beq removeScreen
                          ldrb r10, [r9, #3]
                          cmp r10, #0
                          beq removeScreen
                          ldrb r10, [r9, #6]
                          cmp r10, #0
                          beq removeScreen
                          ldrb r10, [r9, #7]
                          cmp r10, #0
                          beq removeScreen
                          ldrb r10, [r9, #9]
                          cmp r10, #0
                          beq removeScreen
                          ldrb r10, [r9, #10]
                          cmp r10, #0
                          beq removeScreen
                          ldrb r10, [r9, #11]
                          cmp r10, #0
                          beq removeScreen
                          ldrb r10, [r9, #12]
                          cmp r10, #0
                          beq removeScreen



                          b PauseScreenLoop


          restart:
                //reset all variables
                ldr r1, =mario
                mov r2, #0
                str r2, [r1]
                ldr r2, =0x1e7
                str r2, [r1, #4]

                ldr r1, =dragonEnemy
                mov r2, #500
                str r2, [r1]
                ldr r2, =0x1f1
                str r2, [r1, #4]

                ldr r1, =shellEnemy
                ldr r2, =0x25d
                str r2, [r1]
                ldr r2, =0x1fb
                str r2, [r1, #4]

                ldr r1, =screenNumber
                mov r2, #1
                str r2, [r1]

                ldr r1, =block1
                ldr r2, =0x262
                str r2, [r1]
                mov r2, #400
                str r2, [r1, #4]

                ldr r1, =block2
                mov r2, #700
                str r2, [r1]
                mov r2, #400
                str r2, [r1, #4]

                ldr r1, =block3
                mov r2, #190
                str r2, [r1]
                mov r2, #440
                str r2, [r1, #4]

                ldr r1, =block4
                mov r2, #260
                str r2, [r1]
                ldr r2, =0x186
                str r2, [r1, #4]

                ldr r1, =cblock
                ldr r2, =0x28f
                str r2, [r1]
                mov r2, #400
                str r2, [r1, #4]

                ldr r1, =cblock2
                ldr r2, =0x10e
                str r2, [r1]
                ldr r2, =0x15e
                str r2, [r1, #4]

                ldr r1, =cblock3
                ldr r2, =0x302
                str r2, [r1]
                ldr r2, =0x15e
                str r2, [r1, #4]

                ldr r1, =pipe1
                mov r2, #250
                str r2, [r1]
                mov r2, #472
                str r2, [r1, #4]

                ldr r1, =pipe2
                ldr r2, =0x2ee
                str r2, [r1]
                mov r2, #472
                str r2, [r1, #4]

                ldr r1, =castle
                ldr r2, =0x29a
                str r2, [r1]
                mov r2, #199
                str r2, [r1, #4]

                ldr r1, =bowser
                mov r2, #400
                str r2, [r1]
                ldr r2, =0x1a9
                str r2, [r1, #4]

                ldr r1, =pit
                mov r2, #200
                str r2, [r1]
                ldr r2, =0x22d
                str r2, [r1, #4]



                ldr r1, =lives
                mov r2, #3
                str r2, [r1]

                ldr r1, =score
                mov r2, #0
                str r2, [r1]

        select1:
                ldr r1, =playingstatus
                mov r2, #1
                str r2, [r1]
                mov r6, #1
                ldr r5, =currentSelectionPause
                ldr r5, [r5]
                cmp r5, r6
                beq nG
                ldr r1, =playingstatus
                mov r2, #0
                str r2, [r1]
                b _start  //back to stary menu, need to reset all values


      removeScreen:
                    bl clearPauseMenu
                    pop {r5, r6, r7, r8, r9, r10, lr}
                    mov pc, lr



          Up:
              push {lr}
              ldr r0, =selectcoin4
              ldr r0, [r0]
              ldr r1, =selectcoin4
              ldr r1, [r1,#4]
              bl clearselectCoin

              ldr r0, =selectcoin3
              ldr r0, [r0]
              ldr r1, =selectcoin3
              ldr r1, [r1,#4]
              bl drawselectCoin

              ldr r2, =currentSelectionPause
              mov r3, #1
              str r3, [r2]

              pop {lr}
              mov pc, lr

          Down:
                push {lr}
                ldr r0, =selectcoin3
                ldr r0, [r0]
                ldr r1, =selectcoin3
                ldr r1, [r1,#4]
                bl clearselectCoin

                ldr r0, =selectcoin4
                ldr r0, [r0]
                ldr r1, =selectcoin4
                ldr r1, [r1,#4]
                bl drawselectCoin

                ldr r2, =currentSelectionPause
                mov r3, #0
                str r3, [r2]

                pop {lr}
                mov pc, lr

          clearPauseMenu:
                          push {r7, r8, lr}
                          mov r0, #0    //pass in starting x
                          mov r1, #0    //pass in starting y
                          ldr r2, =clearPauseImage //address of picture
                          ldr r7, =0x21b
                          ldr r8, =0x131
                          bl  drawPicture

                          ldr r0, =selectcoin3
                          ldr r0, [r0]
                          ldr r1, =selectcoin3
                          ldr r1, [r1,#4]
                          bl clearselectCoin

                          ldr r0, =selectcoin4
                          ldr r0, [r0]
                          ldr r1, =selectcoin4
                          ldr r1, [r1,#4]
                          bl clearselectCoin

                          ldr r1, =playingstatus
                          mov r2, #1
                          str r2, [r1]

                          pop {r7, r8, lr}
                          mov pc, lr


